import { PoolConfig, QuoteToken, PoolCategory } from './types'
import { defaultToken } from '../../app.config'
import tokens from './tokens'

const pools: PoolConfig[] = [
  {
    sousId: 4,
    stakingToken: tokens.question,
    earningToken: tokens.question,
    apy: 182.5,
    rewardRate: 577,
    contractAddress: {
      97: '',
      56: '0xf775475A4Aad7364B85aA6319b8cdc1879D63b7B',
    },
    poolCategory: PoolCategory.CORE,
    harvest: true,
    tokenPerBlock: '0.00007234',
    sortOrder: 999,
    isFinished: false,
  },
